import React from "react";

class ComponentClass extends React.Component {
  //const { brand, maker, year, price, color } = this.props.details;

  render() {
    let styles = { color: "red", fontSize: "28px" };
    let classesStyles = {
      margin: "20px",
      height: "100px",
      backgroundColor: "blue",
      color: "white"
    };
    return (
      <div>
        <div style={styles}>
          <h1>Header. 5 + 5 = {5 + 5}</h1>
        </div>
        <div style={classesStyles}>
          <h1>Hello World from component class</h1>
          <h1>This is a new h1</h1>
        </div>
      </div>
    );
  }
}

export default ComponentClass;

